"use client"
import React, { useState }  from 'react'
import Image from 'next/image'
import { Button } from "./ui/button";
import { Movie } from '../../typings';
import { Movies } from '../../typings';
import Templat from '@/app/Templaite';

function WishListButton({ wl }: { wl: boolean }) {
  
  
  const [wll, setIsToggled] = useState(true);
  
  // Function to handle click event
  const handleClick = () => {
    // Toggle the boolean value
    setIsToggled(wl => !wl);
  }; 


   
  return (
    <div>
      {wll? (
        <Button onClick={handleClick} className="bg-[#2c315b] border-[#1d213f] space-x-2 p-4">
                  <Image
                              alt="Add"
                              src="data:image/svg+xml;base64," 
                              width={20}
                              height={20}
                          />
                  <p>Add to WishList</p>
        </Button>

      ): (
        <Templat><Button onClick={handleClick} className="bg-[#3a49d4] hover:bg-[#343d91] border-[#1d213f] space-x-2.5 p-4">
                    <Image
                                alt="Minus"
                                src="data:image/png;base64,"
                                width={16}
                                height={16}
                            />
                    <p>Added  WishList</p>
          </Button></Templat>
          
      )}
        </div>
  )
}

export default WishListButton
